import './App.css';
import Moviecard from './components/card/Moviecard';
import Movielist from './components/movielist/Movielist';


function App() {
  return (
    <div>{

      Movielist.map((item) => {
        return <Moviecard titleCard={item.title} yearCard={item.year} directorCard={item.director} durationCard={item.duration} genreCard={item.genre} rateCard={item.rate} />
      })
    }</div>);

}

export default App;
